import com.eviware.soapui.support.XmlHolder
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def holder = groovyUtils.getXmlHolder( "GetCurrencyByCountry#Response" )
def CDATAXml = holder.getNodeValue("//*:GetCurrencyByCountryResult/text()")
def CDATAXmlHolder = new XmlHolder(CDATAXml)

def currency = CDATAXmlHolder.getNodeValue("//Table/Currency")
log.info("currency: " + currency)
testRunner.testCase.setPropertyValue( "currency", currency)
